import jwt from 'jsonwebtoken';
import bcrypt from "bcrypt";
import { v4 as uuidv4 } from "uuid";
import { getConnection } from "../../database/database";

const TABLE_USERS = "users";
const getUser = async (req, res) => {
  try {
    const { email, password } = req.body;
    const connection = await getConnection();
    // Find the user by their username in the database

    const results = await connection.query(
      `SELECT * FROM ${TABLE_USERS} WHERE email = ?`,
      [email]
    );

    if (results.length === 0) {
      return res.status(401).send("User not found");
    }
    const user = results[0];
    // Compare the provided password with the stored hash
    const passwordMatch = await bcrypt.compare(password, user.hashpassword);
    if (passwordMatch) {
      const token = jwt.sign({ username: user.name }, "secret", {
        expiresIn: "1h",
      });
      return res.json({ name: user.name, email: user.email, token });
    } else {
      // Passwords don't match, authentication failed
      return res.status(401).send("Authentication failed");
    }
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};

const createUser = async (req, res) => {
  try {
    console.log(req.body);
    const { email, name, password } = req.body;
    if (!email || !name || !password) {
      res.status(400).json("Bad request , Please fill all field");
    }
    const hash = await bcrypt.hash(password, 10);
    const user = {
      id: uuidv4(),
      hashpassword: hash,
      email,
      name,
    };
    const connection = await getConnection();
    connection.query(`INSERT INTO ${TABLE_USERS} SET ?`, user);
    res.json({ message: "Created user succesfuly" });
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};

export const methods = {
  getUser,
  createUser,
};

