sourcesContent:
import { v4 as uuidv4 } from "uuid";
import moment from "moment";
import { getConnection } from "../../database/database";

const TABLE_SEATS = "seats";

const createSeat = async (req, res) => {
  try {
    const { vanId, status, seatNumber } = req.body;
    if (!vanId || !status || !seatNumber) {
      res.status(400).json("Bad request , Please fill all field");
    }
    const seat = {
      id: uuidv4(),
      seatNumber,
      status,
      vanId,
      created_at: moment().format("L"),
    };
    const connection = await getConnection();
    connection.query(`INSERT INTO ${TABLE_SEATS} SET ?`, seat);
    res.json({ message: "Create seat succesfuly" });
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};

const getSeatsByVanId = async (req, res) => {
  try {
    const { vanId } = req.body;
    const connection = await getConnection();
    const results = await connection.query(
      `SELECT * FROM ${TABLE_SEATS} WHERE vanId = ?`,
      [vanId]
    );

    if (results.length === 0) {
      return res.status(401).send("Seats not found by patent");
    }
    return res.json(results);
  } catch (error) {
    res.status(500);
    res.send(error.message);
  }
};

export const methods = {
  createSeat,
  getSeatsByVanId,
};

