import { v4 as uuidv4 } from "uuid";
import moment from "moment";
import { getConnection } from "../../database/database";
import { TABLE_SEATS } from "../../const";

const createSeat = async (req, res) => {
  try {
    const { vanId, status, seatNumber } = req.body;
